import React from "react";
import "../bower_components/materialize/dist/css/materialize.css";
import "./style.css";
import Post from "./post"

class Index extends React.Component{
    constructor(){
        super()
        this.state={
        index:true,
        name : "",
        body:"",
        title:"",
        fav:"",
        lib:"",
        plf:"",

        }

    }

    render(){

        return(
            <div>
                <Post  logout={this.logout} user ={this.state.user} isLogging = {this.state.isLogging} index ={this.state.index}/>

            </div>
        );
    }
}

export default Index
